  bgColor: '#fafafa',
  headerColor: 'rgba(255, 255, 255, 0.8)',
  headerHeight: '230px',
  homeBgColor: '#090B0B',
  mainFontWeight: 200,
  pinkColor: '#ffe7e7',
  whiteColor: '#ffffff',
  mainBorder: '1px solid #dbdbdb',
  boldMainBorder: '2px solid #dbdbdb',
  pinkBorder: '2px solid #ffe7e7',
  blueBorder: '2px solid #0a97b0',
  boldPinkBorder: '5px solid #ffbfc1',
  borderTop: '1px solid black',
  whiteBox: `border:${BOX_BORDER};
             border-radius:${BORDER_RADIUS};
